// src/App.js
import React from 'react';
import './App.css';
import SearchBar from './SearchBar';
import logo from './assets/jek_logo.png'; // Importe o logo

const App = () => {
    return (
        <div style={{ position: 'relative' }}>
            <img 
                src={logo} 
                alt="Logo da biblioteca" 
                style={{
                    position: 'absolute',
                    top: '10px',
                    left: '10px', // Posiciona o logo no canto superior esquerdo
                    width: '50px', // Tamanho do logo
                    height: 'auto'
                }}
            />
            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
                <h1 style={{ color: '#cedae1', marginRight: '20px' }}>jeKlibrary</h1>
                <SearchBar />
            </div>
        </div>
    );
};

export default App;
